import React from "react";
import Article from "/src/components/ui/article/article";
import { Ul } from "/src/components/styled";
import { StyledUl, StyledLi } from "./styles";
import articles from "/src/mocks/articles";

function Blog() {
  return (
    <>
      <StyledUl>
        {articles.map((article) => (
          <StyledLi key={article.id}>
            <Article {...article} />
          </StyledLi>
        ))}
      </StyledUl>
    </>
  );
}

export default Blog;
